    ##Sistema de origem : user-template-04
    ##ID teste : id
    ##steps : steps
    ##Caso de teste(CT) : name
    ##Usuario do CT : user-template-07
    Flag = False
    i = 0
    return_list = []
    try:
        while not Flag:
            try:
                if meta_data['entities'][i]['Fields'] is not None:
                    try:
                        for k in meta_data['entities'][i]['Fields']:
                            if k['Name'] == value:
                                values = k['values']
                                values += [f"id_ref {i}"]
                                i += 1
                                return_list.append(values)
                        if return_list == []:
                            Flag = True
                            raise Exception
                    except:
                        Flag = True
                        raise Exception
                else:
                    Flag = True
                    raise Exception 
            except:
                if return_list == []:
                    Flag = True
                    raise Exception                
                Flag = True
        if i == 0:
            raise Exception
            
    except Exception as e:
        Flag = True
        e = "Wrong Parameter"
        return f"Error: {e}"
    return return_list
