# Função que filtra a entidade desejada  e retorna:
# name = nome
# value = valor
# text = texto
def filter_entities(message, entityName, name_value_text):
    entities = message['entities']
    input_len = len(entities)
    result = None
    if name_value_text == 'name':
        for i in range(input_len):
            if entities[i]['entity'] == entityName:
                result = entityName

    if name_value_text == 'value':
        for i in range(input_len):
            if entities[i]['entity'] == entityName:
                result = entities[i]['value']

    if name_value_text == 'text':
        for i in range(input_len):
            if entities[i]['entity'] == entityName:
                result = entities[i]['text']

    return result

