    runs = runs_json
    owners = filter_in_runs('owner',runs)
    for i in range(0, len(owners)-1):
        if owners[i][0]['value'] == user:
            if filter_in_runs('id',runs)[i][0]['value'] == id_value:
                origin_system = filter_in_runs('user-template-04',runs)[i][0]['value'] if filter_in_runs('user-template-04',runs)[i][0] else None
