# log de mensagens
def log(message):
    date = datetime.now(timezone('America/Sao_Paulo')).replace(microsecond=0).isoformat()
    try:
        print(
            f"[{date}]"
            f"[{message['intent']['name']}|"
            f"{message['intent']['confidence']:0.2f}]"
            f"{[(item['entity'], item['value']) for item in message['entities']] if message['entities'] else '[-]'} > "
            f"{message['text']}"
        )
    except KeyError:
        pass


